// src/App.jsx (version corrigée)
import {
  BrowserRouter,
  Routes,
  Route,
  Navigate,
  useLocation
} from 'react-router-dom';
import { DarkModeProvider } from './Components/DarkModeContext';

// Importations regroupées par catégorie
import {
  Accueil,
  Home,
  Login,
  Register
} from './Pages/Home';

import {
  MesCandidatures,
  CreerOffre,
  OffreDetails
} from './Pages/Offre';

import {
  PostulerOffre,
  EntrepriseHome
} from './Pages/Entreprise';

import {
  MinistereHome,
  GestionCandidatures
} from './Pages/Ministere';

import {
  DashboardAdmin,
  DashboardEntreprise,
  DashboardMinistere
} from './Pages/Dashbord';

import Navbar from './Components/Navbar';
import PrivateRoute from './Components/PrivateRoute';

function App() {
  const location = useLocation();
  const hideNavbar = ['/login', '/register'].includes(location.pathname.toLowerCase());

  return (
    <DarkModeProvider>
      {!hideNavbar && <Navbar />}
      <Routes>
        {/* Routes publiques */}
        <Route path="/" element={<Accueil />} />
        <Route path="/home" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/offre/:id" element={<OffreDetails />} />

        {/* Routes protégées */}
        <Route path="/ministere/*" element={
          <PrivateRoute roles={['ministere']}>
            <MinistereRoutes />
          </PrivateRoute>
        } />

        <Route path="/entreprise/*" element={
          <PrivateRoute roles={['entreprise']}>
            <EntrepriseRoutes />
          </PrivateRoute>
        } />

        <Route path="/dashboard/admin" element={
          <PrivateRoute roles={['admin']}>
            <DashboardAdmin />
          </PrivateRoute>
        } />

        <Route path="*" element={<Navigate to="/" replace />} />
      </Routes>
    </DarkModeProvider>
  );
}

// Sous-routes pour une meilleure organisation
function MinistereRoutes() {
  return (
    <Routes>
      <Route path="home" element={<MinistereHome />} />
      <Route path="gestion-candidatures" element={<GestionCandidatures />} />
      <Route path="creer-offre" element={<CreerOffre />} />
      <Route path="dashboard" element={<DashboardMinistere />} />
    </Routes>
  );
}

function EntrepriseRoutes() {
  return (
    <Routes>
      <Route path="home" element={<EntrepriseHome />} />
      <Route path="mes-candidatures" element={<MesCandidatures />} />
      <Route path="postuler/:offerId" element={<PostulerOffre />} />
      <Route path="dashboard" element={<DashboardEntreprise />} />
    </Routes>
  );
}

export default function AppWrapper() {
  return (
    <BrowserRouter>
      <App />
    </BrowserRouter>
  );
}
